import { View } from 'react-native';

// Components
import CustomText from './CustomText';

function Offers() {
	return (
		<Fragment>
			<CustomText customStyle={{ textAlign: 'right', marginRight: 30 }}>پیشنهاد ویژه</CustomText>
		</Fragment>
	);
}

export default Offers;
